import React,{Component} from 'react';
import './App.css';
import tasks from './sample/tasks.json';
import Tasks from './component/Tasks';


class App2 extends Component{
  state = {
    tasks: tasks
  }

  render (){

    return <Tasks tasks={this.state.tasks}/>
  }

}


function Text(){
   return (<div class="container"> <h1> Dise√±a tu hogar </h1>  <h2> Estiliza tu casa </h2>   </div> );
}
function Items(){
  return (
  <div className="items">
      <Item type="About"/>  
      <Item type="Proyect"/>  
      <Item type="Contact"/> 
  </div> );}
const Item = (props) => <a className="item" href="hello"> {props.type}</a>;
function Brand(){
  return <div className="brand">Logo corporativo</div> 
}
function App() {
  return (
    <div className="App" >
       <nav className="navbar">  <div className="bar"><Brand/>   <Items/> </div>   </nav> 
       <header className="header"> <Text/> </header> 
       <div className="spacing"> <App2/> </div>
    </div>
  );
}

export default App;
